		public UserService()
		{
			_users = new List<User>();
			_chipGroups = new List<string>();

			GenerateUsers();
		}

		public void GenerateUsers()
		{
			string userString = "";
			if (File.Exists("users.json"))
			{
				userString = File.ReadAllText("users.json");

			}
			else
			{
				userString = DEFAULT_USERS;
			}
			JArray userArray = JArray.Parse(userString);

			foreach (JObject userObject in userArray)
			{
				string sub = "";
				string name = "";
				string email = "";
				string title = "";
				string bio = "";
				string image = "";
				string imageURL = "";
				IEnumerable<JToken> groups;

				if (userObject.ContainsKey("name"))
				{
					name = userObject["name"].ToString();
				}
				else
				{
					throw new Exception("Trying to load users.json file. 'name' field missing.");
				}

				if (userObject.ContainsKey("subject"))
				{
					sub = userObject["subject"].ToString();
				}
				else
				{
					sub = "sportal-" + name.Replace(" ", string.Empty);
				}

				if (userObject.ContainsKey("email"))
				{
					email = userObject["email"].ToString();
				}
				else
				{
					email = name.Replace(" ", string.Empty) + "@sportal.dev";
				}

				if (userObject.ContainsKey("title"))
				{
					title = userObject["title"].ToString();
				}
				else
				{
					throw new Exception("Trying to load users.json file. 'title' field missing.");
				}

				if (userObject.ContainsKey("biography"))
				{
					bio = userObject["biography"].ToString();
				}

				bool useDefaultImage = false;
				if (userObject.ContainsKey("image"))
				{
					image = userObject["image"].ToString();

					if (image.EndsWith(".png") | image.EndsWith(".jpg") | image.EndsWith(".jpeg") | image.EndsWith(".bmp") | image.EndsWith(".tiff"))
					{
						if (image.StartsWith("http"))
						{
							imageURL = image;
						}
						image = GetBase64PNG(image);
						if (string.IsNullOrEmpty(image))
						{
							useDefaultImage = true;
						}
					}
				}
				else
				{
					useDefaultImage = true;
				}
				if (useDefaultImage)
				{
					image = "";
				}

				if (userObject.ContainsKey("groups"))
				{
					groups = userObject["groups"].Children();
				}
				else
				{
					throw new Exception("Trying to load users.json file. 'groups' field missing.");
				}

				List<string> groupList = new List<string>();
				foreach (JToken group in groups)
				{
					groupList.Add(group.ToString());
					if (!_chipGroups.Contains(group.ToString()))
					{
						_chipGroups.Add(group.ToString());
					}
				}

				_users.Add(new User(sub, name, email, title, bio, image, imageURL, groupList.ToArray()));
			}
		}

		public Task<User[]> GetUserListAsync()
		{
			return Task.FromResult(_users.ToArray());
		}

		public Task<string[]> GetChipGroupsAsync()
		{
			return Task.FromResult(_chipGroups.ToArray());
		}

		public void RefreshUsers()
		{
			_users.Clear();
			_chipGroups.Clear();

			GenerateUsers();
		}

		private string GetBase64PNG(string path)
		{
			string base64Png = "";
			Bitmap b;

			if (path.StartsWith("http"))
			{
				WebClient client = new WebClient();
				Stream stream = client.OpenRead(path);
				b = new Bitmap(stream);
			}
			else
			{
				if (!File.Exists(path))
				{
					Console.WriteLine("Image not found at '" + path + "', using default image instead.");
					return "";
				}

				b = (Bitmap)Bitmap.FromFile(path);
			}
			float newWidth;
			float newHeight;
			if (b.Width > b.Height)
			{
				newWidth = 132;
				newHeight = (b.Height * 132) / b.Width;
			}
			else
			{
				newHeight = 132;
				newWidth = (b.Width * 132) / b.Height;

			}

			b = new Bitmap(b, new Size((int)newWidth, (int)newHeight));

			using (MemoryStream ms = new MemoryStream())
			{
				b.Save(ms, ImageFormat.Png);
				byte[] imageBytes = ms.ToArray();
				base64Png = Convert.ToBase64String(imageBytes);
			}
			return base64Png;
		}
